// In src/components/GalleryPage.js

import React from 'react';
import UploadForm from './UploadForm'; // Make sure you've created this component
import './GalleryPage.css'; // Assuming you have this CSS file for styling the gallery

function GalleryPage() {
  // Example array of image URLs from RoboHash
  const images = [
    'https://robohash.org/1?set=set1',
    'https://robohash.org/2?set=set1',
    'https://robohash.org/3?set=set1',
    'https://robohash.org/4?set=set1',
    'https://robohash.org/5?set=set1',
    // Add as many as you like
  ];

  return (
    <div>
      <UploadForm /> {/* Upload Form at the top */}
      <div className="gallery-container">
        {images.map((image, index) => (
          <div key={index} className="image-container">
            <img src={image} alt={`Robot ${index + 1}`} className="gallery-image" />
          </div>
        ))}
      </div>
    </div>
  );
}

export default GalleryPage;
